import { AppContext } from '../provider/StateProvider';
import './dashboard.css';

export default class Dashboard extends Component {
  render() {
    console.log(AppContext);
    return (
      <div className="card">
        <h1>
          <AppContext.Consumer>{context => context.test}</AppContext.Consumer>
        </h1>
      </div>
    );
  }
}
